import React from 'react';
import Loginform from "./loginForm";


function About() {
    return (
    <div>
      <NavLink to="/">Home</NavLink>
      <NavLink to="/about">About</NavLink>
      <NavLink to="/contact">Contact</NavLink>

        <h2>About Page</h2>
    <Loginform />
    </div>)

}

export default About;
